BITS 32
; flag: RC3-2016-YEAH-DATS-BETTER-BOII
; based on http://www.muppetlabs.com/~breadbox/software/tiny/teensy.html
              org     0x08048000
ehdr:
              db      "FLAG"             ; e_ident
              db      1, 1, 1, 0, 0
_start:       mov     ecx,promptsize
              jmp     main
              dw      2                       ; e_type
              dw      3                       ; e_machine
              dd      1                       ; e_version
              dd      _start                  ; e_entry
              dd      phdr - $$               ; e_phoff
              dd      0                       ; e_shoff
              dd      0                       ; e_flags
              dw      ehdrsize                ; e_ehsize
              dw      phdrsize                ; e_phentsize
phdr:         dd      1                       ; e_phnum       ; p_type
                                              ; e_shentsize
              dd      0                       ; e_shnum       ; p_offset
                                              ; e_shstrndx
ehdrsize      equ     $ - ehdr
              dd      $$                                      ; p_vaddr
              dd      $$                                      ; p_paddr
              dd      filesize                                ; p_filesz
              dd      filesize                                ; p_memsz
              dd      5                                       ; p_flags
              dd      0x1000                                  ; p_align
phdrsize      equ     $ - phdr
memcmp:       ;memory comparsion function, b1 in esi, b2 in edi, count in ecx
              push ecx
              xor eax,eax
cmploop:      test ecx,ecx
              jz endmemcmp
              mov edx, edi
              add edx,ecx
              mov bl, byte [edx]
              mov edx, esi
              add edx,ecx
              sub bl, [edx]
              add eax,ebx
              dec ecx
              jmp cmploop
endmemcmp:    pop ecx
              ret

print:        ;print function deobfuscates string then writes (0x55 is key) len in ecx, bufptr in esi
              test ecx,ecx
              jz endprint
              mov al, byte [esi]
              xor al,0x55
              push eax
              mov eax,4
              mov ebx,1
              mov edx,1
              push ecx
              lea ecx,[esp+4]
              int 0x80
              pop ecx
              pop eax
              inc esi
              dec ecx
              jmp print
endprint:     ret

main:         ;decode stuff from other program
              ;include other program here
              ;get offset of '3+yI&*v/.+sI$6j+8Ix%-"\x12!)0\x120.*\x12W"6'
              ;xor it
              mov esi,prompt
              call print
              sub  esp, 60
              mov  al,3
              mov  bl,1
              mov  dl,60
              mov  ecx, esp
              int 0x80
              cmp eax,31
              jne nope
              mov ebx,eax
              add ecx,eax
              inc ecx
              mov byte [ecx], 0
              mov esi,esp ;user buf in esi
              call h
here          equ    $ - $$
h:            pop ecx
              sub ecx,here
              push ecx
              push 0x0
              push 0x0
              mov eax, [ecx+val0off]
              bswap eax
              push eax
              mov eax, [ecx+val1off]
              bswap eax
              push eax
              mov eax, [ecx+val2off]
              bswap eax
              push eax
              mov eax, [ecx+val3off]
              bswap eax
              push eax
              mov eax, [ecx+val4off]
              bswap eax
              push eax
              mov eax, [ecx+val5off]
              bswap eax
              push eax
              mov eax, [ecx+val6off]
              bswap eax
              push eax
              mov eax, [ecx+val7off]
              bswap eax
              push eax
              mov eax, [ecx+val8off]
              bswap eax
              push eax
              mov eax,esp ;key ptr in eax
              dec ebx
              xor ecx,ecx ;nread in ebx, ctr in ecx
enc:          cmp ecx,ebx
              jge comp
              mov dl, byte [eax] ;byte in dl
              xor dl, byte [esi+ecx]
              mov byte [esi+ecx], dl
              add eax,1
              add ecx,1
              jmp enc
              ;nread in ebx
comp:         add esp,11*4
              pop ecx
              lea edi,[keyoff+ecx]
              mov ecx,ebx
              dec ecx
              mov esi,esp
              call memcmp
              test eax,eax
              jnz nope
              mov ecx,yessize
              mov esi,yes
              call print
              jmp exit
nope:         mov ecx,nosize
              mov esi,no
              call print
exit:         mov eax,1
              mov ebx,1
              int 0x80
